import "./header.css"

export default function header() {
    return  (
        <div className="header">
            <div className="headerTitles">
                <span className="headerTitlesSm">Film | Music | Sports</span>
                <span className="headerTitlesLg">Weeks Agenda</span>
            </div>  
            <img className="headerImg" src="https://media.istockphoto.com/id/1020752970/photo/downtown-charlotte-north-carolina-usa-skyline-aerial.webp?b=1&s=170667a&w=0&k=20&c=upI1knkkMiJdGufrwVtubxWx4BWCHTFsepJPXMpqfBo=" alt="" />
    </div>
    )
}
